import React, { useEffect, useState } from "react";
import { motion } from "framer-motion";
import map from "./assets/map.png";

// Algorithm color palette
const COLOR_HEX = {
  dijkstra: "#60A5FA",
  bellman: "#34D399",
  floyd: "#F87171",
  astar: "#FACC15",
  johnson: "#C084FC",
  default: "#94A3B8",
};

export default function Visualizer({ path = [], distance = 0, algorithm = "" }) {
  const [size, setSize] = useState({ width: 1200, height: 700 });

  useEffect(() => {
    const onResize = () => {
      const mapContainer = document.getElementById("map-container");
      if (mapContainer) {
        setSize({
          width: mapContainer.offsetWidth,
          height: mapContainer.offsetHeight,
        });
      }
    };
    onResize();
    window.addEventListener("resize", onResize);
    return () => window.removeEventListener("resize", onResize);
  }, []);

  const { width, height } = size;

  // City coordinates (in percentage of map)
  const cityCoords = {
    A: { x: 5, y: 80 },
    B: { x: 15, y: 70 },
    C: { x: 10, y: 50 },
    D: { x: 20, y: 40 },
    E: { x: 25, y: 75 },
    F: { x: 30, y: 65 },
    G: { x: 25, y: 40 },
    H: { x: 35, y: 50 },
    I: { x: 45, y: 40 },
    J: { x: 40, y: 75 },
    K: { x: 50, y: 65 },
    L: { x: 40, y: 30 },
    M: { x: 50, y: 45 },
    N: { x: 60, y: 35 },
    O: { x: 55, y: 75 },
    P: { x: 65, y: 60 },
    Q: { x: 70, y: 45 },
  };

  // Scale percentage coordinates to pixels
  const scaled = {};
  for (const k in cityCoords) {
    scaled[k] = {
      x: (cityCoords[k].x / 100) * width,
      y: (cityCoords[k].y / 100) * height,
    };
  }

  // Valid path
  const safePath = Array.isArray(path) ? path.filter((n) => n && scaled[n]) : [];
  if (safePath.length < 2) {
    return (
      <div className="flex items-center justify-center h-screen text-white text-xl">
        No valid route found.
      </div>
    );
  }

  const colorHex =
    COLOR_HEX[algorithm.toLowerCase()] || COLOR_HEX.default;

  // Plane animation points
  const planePoints = safePath.map((node) => scaled[node]);
  const planeXs = planePoints.map((p) => p.x);
  const planeYs = planePoints.map((p) => p.y);
  const times = planeXs.map((_, i) => i / (planeXs.length - 1));

  // Helper to draw one segment
  function Segment({ from, to, colorHex, delay = 0 }) {
    const a = scaled[from];
    const b = scaled[to];
    if (!a || !b) return null;
    const dx = b.x - a.x;
    const dy = b.y - a.y;
    const len = Math.hypot(dx, dy);
    const angle = Math.atan2(dy, dx);
    return (
      <motion.div
        key={`seg-${from}-${to}`}
        initial={{ scaleX: 0 }}
        animate={{ scaleX: 1 }}
        transition={{ duration: 0.9, delay }}
        style={{
          position: "absolute",
          left: a.x,
          top: a.y,
          width: len,
          height: 4,
          background: colorHex,
          transformOrigin: "0% 50%",
          transform: `rotate(${angle}rad)`,
          boxShadow: `0 0 10px ${colorHex}aa`,
          zIndex: 10,
        }}
      />
    );
  }

  return (
    <div
      id="map-container"
      style={{
        width: "100%",
        height: "100vh",
        position: "relative",
        backgroundImage: `url(${map})`,
        backgroundSize: "cover",
        backgroundPosition: "center",
        overflow: "hidden",
      }}
    >
      {/* Route Lines */}
      {safePath.map(
        (node, i) =>
          i < safePath.length - 1 && (
            <Segment
              key={i}
              from={node}
              to={safePath[i + 1]}
              colorHex={colorHex}
              delay={i * 0.15}
            />
          )
      )}

      {/* City markers */}
      {Object.entries(scaled).map(([node, pos]) => (
        <div
          key={node}
          style={{
            position: "absolute",
            left: pos.x,
            top: pos.y,
            transform: "translate(-50%, -50%)",
            background: "#2563eb",
            width: 30,
            height: 30,
            borderRadius: "50%",
            color: "#fff",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            fontWeight: 700,
            fontSize: 12,
            boxShadow: "0 8px 22px rgba(37,99,235,0.25)",
            zIndex: 20,
          }}
        >
          {node}
        </div>
      ))}

      {/* Plane animation */}
      {planeXs.length > 1 && (
        <motion.div
          initial={{ x: planeXs[0], y: planeYs[0] }}
          animate={{ x: planeXs, y: planeYs }}
          transition={{
            duration: Math.max(4, safePath.length * 1.2),
            ease: "easeInOut",
            times,
            repeat: Infinity,
          }}
          style={{
            position: "absolute",
            left: 0,
            top: 0,
            translate: "-50% -50%",
            zIndex: 50,
          }}
        >
          <div style={{ fontSize: 36, textShadow: "0 0 12px rgba(255,255,255,0.2)" }}>
            ✈️
          </div>
        </motion.div>
      )}

      {/* Info box */}
      <div
        style={{
          position: "absolute",
          bottom: 18,
          left: 18,
          background: "rgba(7,11,20,0.8)",
          color: "#fff",
          padding: 12,
          borderRadius: 12,
          backdropFilter: "blur(6px)",
          boxShadow: "0 10px 30px rgba(2,6,23,0.6)",
          fontSize: 13,
        }}
      >
        <div style={{ fontWeight: 700, color: colorHex, marginBottom: 8 }}>
          Algorithm: {algorithm}
        </div>
        <div>Distance: {distance === Infinity ? "∞ (unreachable)" : distance}</div>
        <div>Path: {safePath.join(" → ")}</div>
      </div>
    </div>
  );
}
